import React, { useEffect, useState } from 'react';
import { useSearchParams } from 'react-router-dom';
import HomeCarousel from '../home/HomeCarousel';
import ProductCard from '../common/ProductCard';
import ApiService from '../../service/ApiService';
import '../../style/homePage.css';

const Home = () => {
    const [featuredProducts, setFeaturedProducts] = useState([]);
    const [filteredProducts, setFilteredProducts] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [searchParams] = useSearchParams();
    const searchTerm = searchParams.get('search') || '';

    useEffect(() => {
        fetchFeaturedProducts();
    }, []);

    useEffect(() => {
        if (searchTerm) {
            const filtered = featuredProducts.filter(product => 
                product.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                product.description.toLowerCase().includes(searchTerm.toLowerCase())
            );
            setFilteredProducts(filtered);
        } else {
            setFilteredProducts(featuredProducts);
        }
    }, [searchTerm, featuredProducts]);

    const fetchFeaturedProducts = async () => {
        try {
            setLoading(true);
            const response = await ApiService.getAllProducts();
            console.log('Products response:', response); // Debug log
            const featured = response.productList.slice(0, 8);
            setFeaturedProducts(featured);
            setFilteredProducts(featured);
        } catch (error) {
            console.error('Error fetching featured products:', error);
            setError('Failed to load featured products');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="home-page">
            <HomeCarousel />

            <div className="container">
                <section className="featured-section">
                    <h2 className="section-title">
                        {searchTerm ? `Search Results for "${searchTerm}"` : 'Featured Products'}
                    </h2>
                    <p className="section-description">
                        {searchTerm 
                            ? `Found ${filteredProducts.length} products matching your search`
                            : 'Discover our handpicked selection of top products'}
                    </p>

                    {loading && <div className="loading">Loading products...</div>}
                    {error && <div className="error">{error}</div>}

                    <div className="featured-products">
                        {filteredProducts.length === 0 ? (
                            <div className="no-results">
                                <p>No products found matching your search.</p>
                            </div>
                        ) : (
                            filteredProducts.map(product => (
                                <ProductCard key={product.id} product={product} />
                            ))
                        )}
                    </div>
                </section>

                {!searchTerm && (
                    <section className="categories-section">
                        <h2 className="section-title">Shop by Category</h2>
                        <div className="category-grid">
                            <a href="/products?category=electronics" className="category-card">
                                <div className="category-icon">🖥️</div>
                                <h3>Electronics</h3>
                            </a>
                            <a href="/products?category=fashion" className="category-card">
                                <div className="category-icon">👕</div>
                                <h3>Fashion</h3>
                            </a>
                            <a href="/products?category=home" className="category-card">
                                <div className="category-icon">🏠</div>
                                <h3>Home & Living</h3>
                            </a>
                            <a href="/products?category=books" className="category-card">
                                <div className="category-icon">📚</div>
                                <h3>Books</h3>
                            </a>
                        </div>
                    </section>
                )}
            </div>
        </div>
    );
};

export default Home;
